import React, { Component } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom'; // Routes 추가
import { connect } from 'react-redux';
import * as actions from '../actions';

import Header from './Header';
import Landing from './Landing';

const Dashboard = () => <h2>Dashboard</h2>;
const SurveyNew = () => <h2>SurveyNew</h2>;

class App extends Component {
  componentDidMount() {
    this.props.fetchUser();
  }

  render() {
    return (
      <div className="container">
        <BrowserRouter>
          <div>
            <Header />
            <Routes> {/* Routes로 감싸기 */}
              <Route path="/" element={<Landing />} /> {/* component 대신 element 사용 */}
              <Route path="/surveys" element={<Dashboard />} /> {/* component 대신 element 사용 */}
              <Route path="/surveys/new" element={<SurveyNew />} /> {/* component 대신 element 사용 */}
            </Routes>
          </div>
        </BrowserRouter>
      </div>
    );
  }
}

export default connect(null, actions)(App);
